/*======= Dropdown Menu Inside Responsive Table ===========*/
$(document).ready(function() {
            var dropdownMenu;
            $('.table').on('show.bs.dropdown', function(e) {
                dropdownMenu = $(e.target).find('.dropdown-menu');
                $('body').append(dropdownMenu.detach());
                var eOffset = $(e.target).offset();
                dropdownMenu.css({ 'display': 'block', 'top': eOffset.top + $(e.target).outerHeight(), 'left': eOffset.left - 140, 'width': '200px' });
                dropdownMenu.addClass("mobPosDropdown");
            });
            $('.table').on('hide.bs.dropdown', function(e) {
                $(e.target).append(dropdownMenu.detach());
                dropdownMenu.hide();
            });
        });


